		"full_text": "2019 한국대중음악상(KMA) 기자회견을 마쳤어요. 기자분들께 말씀드린 것처럼 방탄소년단의 경우에는 [Tear] 앨범과 [Answer]끼리도 경합을 벌였습니다. 화제성은 논외이고, 각 앨범의 음악적인 성취에 관해서 선정위원들이 열띤 토론을 거친 끝에 [Answer]가 최종후보가 되었습니다. https://t.co/jOGvzfEGMD",
